import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './components/navBar';

function App() {
  const appStyles = {
    margin: 0,
    backgroundColor: 'rgb(32,155,71)',
    height: '200vh',
    minHeight: '100vh',
    overscrollBehavior: 'none',
    position: 'relative',
    zIndex: 1,
  };

  return (
    <body style={appStyles}>
      <Navbar />
    </body>
  );
}

export default App;
